import React from 'react';


/**
 * Affiche les forfaits que le site offre en faisant la distinction entre les forfaits déjà achetés et ceux disponibles.
 * @returns 
 */
function ForfaitScreen() {
    return (
        <div>
            Forfait Screen
        </div>
    );
}

export default ForfaitScreen;
